/* Trigger structure for table `breakrules` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `add_unit_after_add_break` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'sa'@'localhost' */ /*!50003 TRIGGER `add_unit_after_add_break` AFTER INSERT ON `breakrules` FOR EACH ROW BEGIN
DECLARE big_id VARCHAR(40);
DECLARE unit_id VARCHAR(40);
SET big_id=(SELECT bigId FROM haulemployeeout WHERE BigEmployeeoutId=new.BigEmployeeoutId);
SET unit_id=(SELECT unitId FROM haulemployeeout WHERE BigEmployeeoutId=new.BigEmployeeoutId);
UPDATE haulunit SET unitMinisMum=unitMinisMum+new.minusNum WHERE unitId=big_id AND bigId=big_id;
END */$$


